import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Search from "./Search";
import Img from "./Img";

function App() {
  return (
    <>
      <Header />
      <Img link="https://picsum.photos/200/300" />
      <Search />
      <Footer />
    </>
  );
}

export default App;
